  input: "\"TEXT\",\"F3XA\",\"\",\"The following is a summary of the response from
    the Ohio Credit Union League Political Action Committee regarding the Federal
    Election Commission letter dated October 9, 2002; Identification Number: C00349902;
    Reference: September Monthly Report (8/1/02-8/31/02).  Additional information
    and documentation will be forwarded by hard copy.  It will include supplementary
    documentation as well. On April 26, 2002, the Ohio Credit Union League Political
    Action Committee (OCULPAC) hosted an event for Ohio Congresswoman Deborah Pryce
    at the Hyatt Regency Hotel (Hyatt) in Columbus, Ohio.  This was prior to the date
    of the Primary in Ohio which was held on May 7, 2002.  The event was paid for
    by OCULPAC as an in-kind contribution for the primary election in the amount of
    $1,135.54.  OCULPAC remitted a check in the amount of $1,135.54 to the Hyatt on
    or about August 5, 2002.  The delay was a result of the Hyatt including the cost
    of the function in the master invoice submitted to OCUL Services Corporation (OSC),
    the subsidiary of the connected organization, the Ohio Credit Union League.  As
    a result, the invoice was inadvertently paid by OSC which included the cost of
    the event.  Upon discovering that the cost was inadvertently paid as part of the
    master invoice, the Hyatt was instructed to reimburse OSC and invoice OCULPAC.
    \ OCULPAC subsequently paid the charges for the event on or about August 5, 2002.\tOn
    April 26, 2002, the Ohio Credit Union League Political Action Committee (OCULPAC)
    hosted an event for Ohio Congresswoman Deborah Pryce.  This event was held prior
    to the date of the Primary Election in Ohio which was held on May 7, 2002.  Prior
    to this event an invitation was mailed to individuals on or about April 16, 2002.
    \ The cost for this postage was $68.00.  This constituted an in-kind contribution
    for the primary election.  The delay in paying the cost of the mailing was a result
    of the cost of the mailing being inadvertently paid for by OCUL Services Corporation
    (OSC), the subsidiary of the Ohio Credit Union League (OCUL), the connected organization
    of OCULPAC.  As a result, upon discovery of this occurrence, OCULPAC forwarded
    a check to OSC in the amount of $68.00 on or about August 1, 2002.\""
